import { Form,Drawer, Icon, Input, Button, Checkbox ,message} from 'antd';
import React from 'react';
import {login} from "../../middleware/users"

class Login extends React.Component {
  handleSubmit =  (e) => {
    e.preventDefault();
    this.props.form.validateFields(async(err, values) => {
      if (!err) {
        console.log(values.email,values)
        let payload={
          email:values.email,
          password:values.password
        }
        let response=await login({...payload})
        localStorage.setItem("user_id",response.data.user_id)
        message.success(response.data.msg, 5);

      }
    });
  };

  render() {
    const { visible } = this.props;
    const { getFieldDecorator } = this.props.form;
    return (
      <Layout>
                <Header style={{ background: '#fff', padding: '50px 100px' }}>

                </Header>
                <Layout style={{ background: '#ffffff' }}>
                    <Content style={{ background: '#fff', padding: 24, margin: ' 0 auto', minHeight: 280, }}>

                        <div className="steps-content">{
                            currentTab === 0 ? <WrappedSignin next={this.next} /> : <WrappedVerifyMail value={this.state.value} previous={this.previous}/>
                        }
                        </div>
                    </Content>
                </Layout>
            </Layout >

    );
  }
}

export const WrappedLogin = Form.create({ name: 'normal_login' })(Login);
